const accountId = props.accountId || context.accountId;
const isSignedIn = !!accountId;

const CONTRACT_ID = "v1.pembrock.near";
const NODE_URL = "https://rpc.mainnet.near.org";
const APP_URL = "https://app.linearprotocol.org";

const convertObjectToArray = (obj) => Object.keys(obj).map((key) => obj[key]);

function getFarmList() {
  const data = Near.view(CONTRACT_ID, "get_farms", {
    from_index: 0,
    limit: 100,
  });
  return convertObjectToArray(data);
}

State.init({
  farmList: getFarmList(),
});

return (
  <>
    <h2>{isSignedIn && accountId}</h2>
    <div>
      {state.farmList?.length > 0 &&
        state.farmList.map((farm) => {
          return (
            <li>
              {farm.token1_id} - {farm.token2_id}
            </li>
          );
        })}
    </div>
  </>
);
